measurements.description:
Eighteen flowers and 14 buds on six evenly arranged up to 81-cm inflorescences; 345-cm circumference plant in a 25-cm plastic azalea pot;
   dorsal sepal chartreuse, veins heavily marked dark mahogany;
synsepal light chartreuse, narrow mahogany veins; 
petals chartreuse, burgundy spots and veins coalescing to dark burgundy distal half;
pouch chartreuse overlaid mahogany, darker mahogany venation;
 staminode cream, blushed mahogany, hirsuite upper margins;
substance firm; texture matte; previous FCC award 20202258.
